#include <iostream>
#include <ostream>
#include <string>
#include <vector>
#include <algorithm>
using namespace std;
 
int power(int a, int b, int m)
{
  if(b == 0)
    return 1;
  if(b == 1)
    return a;
  if(b % 2 == 0)
    return power(a * a % m, b / 2, m);
  else
    return power(a * a % m, b / 2, m) * a % m;
}
 
class PseudoPrimeTest {
 public:
  int firstFail(int q)
  {
    for(int i = 2; i < q; i++)
    {
      if(power(i, q-1, q) % q != 1)
        return i;
    }
    return q;
  };
};

